import Tabs from '../modules/'
import { FC } from "react";
import Footer from "../modules/Footer/Footer";
import Header from "../modules/Header/Header";

interface AboutUsProps {}

const AboutUs: FC<AboutUsProps> = () => {
  return (
    <div>
      <Header />
      <Tabs />
      <Footer />
    </div>
  );
};

export default AboutUs;
